import React from 'react';

const PostList = () => {
    return(
        <>
            <div className="array_tab">
                <button type="button" className="tab_button">전체글</button>
                <button type="button" className="tab_button">개념글</button>
            </div>
            <stlye jsx global>
                {`
                    .array_tab {
                        width: 250px;
                        height: 32px;
                    }
                    .tab_button button {
                        width: 82px;
                        height: 32px;
                        border: 1px solid #ccc;
                        border-radius: 2px;
                        font-size: 14px;
                        font-weight: bold;
                        color: #333;
                        margin-left: -2px;
                    }
                `}
            </stlye>
        </>
    )
}

export default PostList;
